import React from "react";
import TextField from "@material-ui/core/TextField";

const MovieList = () => {
  return (
    <div>
      <React.Fragment>
        <TextField
          type="text"
          id="outlined-basic"
          label="Search"
          variant="outlined"
        />
        Hi
      </React.Fragment>
    </div>
  );
};

export default MovieList;
